// SPDX-License-Identifier: MIT
pragma solidity ^0.8.5;

contract Participation {

    uint private activityId;
    address owner;
    mapping(uint => address) private activityOwners;
    mapping(uint => string) private activityNames;
    mapping(uint => address[]) private activityParticipants;
    mapping(uint => Activity) private activities;

    struct Activity {
        uint id;
        string name;
        uint startTime;
        uint endTime;
        uint createdTime;
    }

    modifier onlyContractOwner(uint activityId_) {
        require(msg.sender == owner);
        _;
    }
    modifier onlyActivityOwner(uint activityId_) {
        require(msg.sender == activityOwners[activityId_]);
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    function addActivity(string memory activityName) public returns (uint) {
        uint activityId_ = activityId + 1;
        activityOwners[activityId_] = msg.sender;
        activityNames[activityId_] = activityName;
        activityId = activityId_;
        return activityId;
    }

    function addActivity2(string memory activityName, uint startTime, uint endTime) public returns (uint) {
        uint activityId_ = activityId + 1;

        Activity memory activity = Activity({
            id: activityId_,
            name: activityName,
            startTime: startTime,
            endTime: endTime,
            createdTime: block.timestamp
        });

        activities[activityId_]     = activity;
        activityOwners[activityId_] = msg.sender;

        activityId = activityId_;
        return activityId;
    }



}
